type Handler func(w http.ResponseWriter, r *http.Request)

func logit(f Handler, w http.ResponseWriter, r *http.Request) {
	url := strings.ToLower(r.URL.Path)
	handler := runtime.FuncForPC(reflect.ValueOf(f).Pointer()).Name()
	log.Print("url: ", url, " -> ", "Hanlder: ", handler)
	f(w, r)
}

func not_found(w http.ResponseWriter, r *http.Request) {
	w.WriteHeader(http.StatusNotFound)
	w.Write([]byte("404 - NotFound"))
}

func index(w http.ResponseWriter, r *http.Request) {
	fmt.Fprintf(w, "This is Index!")
}

func uuid(w http.ResponseWriter, r *http.Request) {
	type UUID [16]byte
	var u UUID
	var clockSeq uint32
	var hardwareAddr []byte
	var timeBase = time.Date(1582, time.August, 18, 0, 0, 0, 0, time.UTC).Unix()
	utcTime := time.Now().In(time.UTC)
	t := uint64(utcTime.Unix()-timeBase)*10000000 + uint64(utcTime.Nanosecond()/100)
	u[0], u[1], u[2], u[3] = byte(t>>24), byte(t>>16), byte(t>>8), byte(t)
	u[4], u[5] = byte(t>>40), byte(t>>32)
	u[6], u[7] = byte(t>>56)&0x0F, byte(t>>48)

	clock := atomic.AddUint32(&clockSeq, 1)
	u[8] = byte(clock >> 8)
	u[9] = byte(clock)

	copy(u[10:], hardwareAddr)

	u[6] |= 0x10 // set version to 1 (time based uuid)
	u[8] &= 0x3F // clear variant
	u[8] |= 0x80 // set to IETF variant

	var offsets = [...]int{0, 2, 4, 6, 9, 11, 14, 16, 19, 21, 24, 26, 28, 30, 32, 34}
	const hexString = "0123456789abcdef"
	result := make([]byte, 36)
	for i, b := range u {
		result[offsets[i]] = hexString[b>>4]
		result[offsets[i]+1] = hexString[b&0xF]
	}
	result[8] = '-'
	result[13] = '-'
	result[18] = '-'
	result[23] = '-'
	resp_body := make(map[string]string)
	resp_body["uuid"] = string(result)
	resp, _ := json.Marshal(resp_body)
	fmt.Fprintf(w, string(resp))

}

func user_agent(w http.ResponseWriter, r *http.Request) {
	fmt.Fprintf(w, r.UserAgent())
}

func headers(w http.ResponseWriter, r *http.Request){
	type HeaderResp struct{
		Headers map[string]string `json:"headers"`
	}
	headers := &HeaderResp{
		Headers:make(map[string]string)}
	for k,v := range r.Header{
		headers.Headers[k] = strings.Join(v,"")
	}
	data,_ := json.Marshal(headers)
	
	fmt.Fprintf(w,string(data))
	
}

type MethodResp struct{
	Args map[string]string `json:"args"`
	Headers map[string]string `json:"headers"`
	Origin string `json:"origin"`
	Url string `json:"url"`
	Method string `json:"method"`
}

func gen_method_resp(r *http.Request)*MethodResp{
	resp_body := &MethodResp{
		Args:make(map[string]string),
		Headers:make(map[string]string),
		Origin:"",
		Url:"",
		Method:"GET"}
	r.ParseForm()
	for k, v := range r.Form {
		resp_body.Args[k] = strings.Join(v, "")
	}

	for k,v := range r.Header{
		resp_body.Headers[k] = strings.Join(v, "")
	}
	return resp_body
}

func get(w http.ResponseWriter, r *http.Request){
	if r.Method != "GET"{
		w.WriteHeader(http.StatusMethodNotAllowed)
		w.Write([]byte("406 - MethodNotAllowed"))
	}else{
		resp :=gen_method_resp(r)
		resp.Method = "GET"
		resp_,_ := json.Marshal(resp)
		fmt.Fprintf(w,string(resp_))
	}
}
