type Mux struct{}

func (p *Mux) ServeHTTP(w http.ResponseWriter, r *http.Request) {
	switch strings.ToLower(r.URL.Path) {
	case "/":
		logit(index, w, r)
	case "/uuid":
		logit(uuid,w, r)
	case "/user-agent":
		logit(user_agent,w,r)
	case "/headers":
		logit(headers,w,r)
	case "/get":
		logit(get,w,r)
	case "/post":
		logit(post,w,r)
	case "/patch":
		logit(patch,w,r)
	case "/put":
		logit(put,w,r)
	case "/delete":
		logit(delete,w,r)
	case "/anything":
		logit(anything,w,r)
	case "/image/png":
		logit(img_png,w,r)
	case "/image/jpeg":
		logit(img_jpeg,w,r)
	case "/image/webp":
		logit(img_webp,w,r)
	case "/image/gif":
		logit(img_gif,w,r)
	case "/image/bmp":
		logit(img_bmp,w,r)
	case "/image/svg":
		logit(img_svg,w,r)
	default:
		not_found(w, r)
	}
	return
}

func show_logo(){
	banner := `
                     _     _   _         _     _
    __ _  ___       | |__ | |_| |_ _ __ | |__ (_)_ __
   / _  |/ _ \ _____| '_ \| __| __| '_ \| '_ \| | '_ \
  | (_| | (_) |_____| | | | |_| |_| |_) | |_) | | | | |
   \__, |\___/      |_| |_|\__|\__| .__/|_.__/|_|_| |_|
   |___/                          |_|
  
`
	fmt.Printf(banner)
}

func main() {
	show_logo()
	mux := &Mux{}
	host_port := ":8080"
	log.Println("", host_port)
	log.Fatal("ListenAndServe: ", http.ListenAndServe(host_port, mux))
}
